Plain &amp; Simple Microsoft SharePoint 2010

This FULL COLOUR, no-nonsense book shows you the quickest ways to access current information, get real-time status updates, and collaborate with co-workers using Microsoft SharePoint 2010. Johnathan and Chris show you how to share all of your information in one location; use document management features to organize information; learn how to use the exciting SharePoint ribbon UI; collaborate with others using the Enterprise Wiki; use SharePoint search to find information in your organization; and customize SharePoint with Themes and Site Settings. The concise, straightforward language, easy-to-follow steps, and screenshots show you exactly what to do. Handy tips teach you new techniques and shortcuts.

